  Profiles in SEG-Y and JPEG Formats From Cruise RAFA08034 off Edgartown, Massachusetts\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 24,\n\t\t\"recent\": 3\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-06-10T02:34:59.075832\",\n\t\"name\": \"08034-boomerprofiles-high-resolution-seismic-reflection-boomer-profiles-in-seg-y-and-jpeg-forma176e4\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey (USGS), in cooperation
  with the National Oceanic and Atmospheric Administration (NOAA) and the Massachusetts
  Office of Coastal Zone Management (MA CZM), is producing detailed geologic maps
  of the coastal sea floor. Imagery, originally collected by NOAA for charting purposes,
  provides a fundamental framework for research and management activities along this
  part of the Massachusetts coastline, shows the composition and terrain of the seabed,
  and provides information on sediment transport and benthic habitat. Interpretive
  data layers were derived from the combined single-beam and multibeam echo-sounder
  data and sidescan-sonar data collected in the vicinity of Edgartown Harbor, Massachusetts.
  During August 2008 seismic-reflection profiles (Boomer and Chirp) were acquired,
  and during September 2008 bottom photographs and surficial sediment data were acquired
  as part of two ground-truth reconnaissance surveys. For more information on the
  seismic surveys see http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2008-034-FA
  These data are also available via GeoMapApp (http://www.geomapapp.org/) and Virtual
  Ocean ( http://www.virtualocean.org/) earth science exploration and visualization
  applications.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
